CREATE DATABASE `prizedata` ;

USE prizedata;

CREATE TABLE `tprizeinfo` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `lotno` varchar(255) DEFAULT NULL,
  `batchcode` varchar(255) DEFAULT NULL,
  `winbasecode` varchar(255) DEFAULT NULL,
  `winspecialcode` varchar(255) DEFAULT NULL,
  `createdate` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=85448 DEFAULT CHARSET=utf8;



CREATE TABLE `tstatisticsdata` (
  `lotno` varchar(20) NOT NULL,
  `batchcode` varchar(20) NOT NULL,
  `name` varchar(255) NOT NULL,
  `value` mediumtext,
  `valueString` mediumtext,
  PRIMARY KEY (`name`,`batchcode`,`lotno`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;




































